import React from "react";
import { Routes, Route } from "react-router-dom";
import "./css/main.css";

import Header from "./components/Header"; // Import du composant d'en-tête
import Footer from "./components/Footer"; // Import du composant de pied de page
import Home from "./pages/Home"; // Import de la page d'accueil
import SignIn from "./pages/SignIn"; // Import de la page de connexion
import UserPage from "./pages/User"; // Import de la page utilisateur
import Error from "./pages/Error"; // Import de la page d'erreur

function App() {
  return (
    <>
      <Header /> {/* Affichage du composant d'en-tête */}
      <Routes>
        {/* Configuration des routes */}
        <Route path="/home" element={<Home />} /> {/* Route pour la page d'accueil */}
        <Route path="/argent-bank-app" element={<Home />} /> {/* Route pour la page d'accueil */}
        <Route path="/sign-in" element={<SignIn />} /> {/* Route pour la page de connexion */}
        <Route path="/user" element={<UserPage />} /> {/* Route pour la page utilisateur */}
        <Route path="/*" element={<Error />} /> {/* Route pour la page d'erreur */}
      </Routes>
      <Footer /> {/* Affichage du composant de pied de page */}
    </>
  );
}

export default App;
